Day 13 of the #AdventOfCode2021 in #rstats was fun! My folding function even fits in a tweet:

fold &lt;- function(x, axis, val) {
  x[[axis]][x[[axis]] &gt; val] &lt;- 
    (val * 2) - x[[axis]][x[[axis]] &gt; val]

  return(x)
}

See the result after all folds below. https://t.co/dRju0OLngx

